  public String compute(String partitions, int target, String fields, String[] values)
  {
    if ("-99".equals(partitions)) {
      return "-99";
    }

    Map mapValues = UDFUtil.getValueMap(fields, values);
    String[] arrPartition = partitions.split(",");
    if (target > arrPartition.length) {
      return "-99";
    }
    String value = (String)mapValues.get(arrPartition[(target - 1)].trim().toLowerCase());
    if (value == null) {
      return "-99";
    }
    return value;
  }
